import React, { useEffect, useState } from 'react'

import * as All from 'react-icons/fa';

const Icons = (props) => { 
  const [importedValue, setImportedValue] = useState(null);
  const val = props; // Set the desired value for val

  useEffect(() => {
    import(`./${val}`).then(module => {
      setImportedValue(module.default);
    });
  }, [val]);  
  return (
    <div>
      <div class="file-icons">{All}</div>
    </div>
  )
}

export default Icons
